import React from 'react';
import ReactDOM from 'react-dom';

import connect from '@vkontakte/vkui-connect-promise';

import {Time} from './components/modules'
import App from './App'

connect.send('VKWe')

ReactDOM.render(<App/>, document.getElementById('root'));
